import React from 'react';

class Search extends React.Component {

  onKeyDown() {
    console.log('key clicked.');
  }

  render() {
    return (
      <div className="ui center aligned grid" style={{ margin: '50px' }}>
        <div className="ui fluid category search">
          <div className="ui icon input">
            <input className="prompt" type="text" placeholder="Search bands..." />
            <i onKeyDown={this.onSearchClick} className="search icon"></i>
          </div>
          <div className="results"></div>
        </div>
      </div>
    );
  }

}

export default Search;
